insert  into `advertises`(`id`,`ref_account_id`,`domain`,`title`,`summary`,`detail`,`audiences`,`created`,`updated`) values (1,1,'gia-su-wa','gia su 1','day kem mon toan\r\nTi?ng khóc không v?i ???c n?i s?u ?âu em.\r\nN??c m?t không ?em l?i chu?i ngày ?m êm ','cu the day kem mon toan In my tuition, I provide an expert, exam-orientated approach to the preparation of VCE Chemistry (I am the author of the ExamMate Chemistry 3 app: see www.h2fusion.com.au for details) and VCE Mathematical Methods. Reservations for 2013 are open - tuition can start at the end of 2012 and continue through the school break. My students generally obtain A or A+ in these subjects. I have great success with guiding students receiving very low grades (e.g. fail) in these subjects in year 11 to obtaining grades of B-A+ in year 12.','Private 1-2-1, Group',NULL,'2013-01-04 08:49:04'),(10,10,'gia-su','gia su 10','123 Hãy bi?t hôm nay mình v?n còn nhau ?ây\r\nN?u l? mai sau tình trôi vào ??ng cay 123 Hãy bi?t hôm nay mình v?n còn nhau ?ây\r\nN?u l? mai sau tình trôi vào ??ng cay 123 Hãy bi?t hôm nay mình v?n còn nhau ?ây\r\nN?u l? mai sau tình trôi vào ??ng cay ','In my tuition, I provide an expert, exam-orientated approach to the preparation of VCE Chemistry (I am the author of the ExamMate Chemistry 3 app: see www.h2fusion.com.au for details) and VCE Mathematical Methods. Reservations for 2013 are open - tuition can start at the end of 2012 and continue through the school break. My students generally obtain A or A+ in these subjects. I have great success with guiding students receiving very low grades (e.g. fail) in these subjects in year 11 to obtaining grades of B-A+ in year 12.','Private 1-2-1, Group','2012-11-16 16:54:03',NULL),(14,14,NULL,'gia su 14','this is a summary Ti?c nu?i thêm chi, hãy c? quên ?i\r\nHãy c? quên ?i bao nhiêu chuy?n tình ?am mê ','In my tuition, I provide an expert, exam-orientated approach to the preparation of VCE Chemistry (I am the author of the ExamMate Chemistry 3 app: see www.h2fusion.com.au for details) and VCE Mathematical Methods. Reservations for 2013 are open - tuition can start at the end of 2012 and continue through the school break. My students generally obtain A or A+ in these subjects. I have great success with guiding students receiving very low grades (e.g. fail) in these subjects in year 11 to obtaining grades of B-A+ in year 12.','Private 1-2-1, Group','2012-11-16 17:33:36','2012-11-20 16:49:35'),(15,16,NULL,'gia su 16','123 Ôi! ??i là ??i d??ng ??i d??ng mông mênh\r\nTình là s?i t? s?i t? mong manh ','In my tuition, I provide an expert, exam-orientated approach to the preparation of VCE Chemistry (I am the author of the ExamMate Chemistry 3 app: see www.h2fusion.com.au for details) and VCE Mathematical Methods. Reservations for 2013 are open - tuition can start at the end of 2012 and continue through the school break. My students generally obtain A or A+ in these subjects. I have great success with guiding students receiving very low grades (e.g. fail) in these subjects in year 11 to obtaining grades of B-A+ in year 12.','Group','2012-11-19 14:51:36',NULL),(16,17,NULL,'gia su 17','The access rules are evaluated one by one in the order they are specified. The first rule that matches the current pattern (e.g. username, roles, client IP, address) determines the authorization result. If this rule is an allow rule, the action can be executed; if it is a deny rule, the action cannot be executed; if none of the rules matches the context, the action can still be executed.','The access rules are evaluated one by one in the order they are specified. The first rule that matches the current pattern (e.g. username, roles, client IP, address) determines the authorization result. If this rule is an allow rule, the action can be executed; if it is a deny rule, the action cannot be executed; if none of the rules matches the context, the action can still be executed.The access rules are evaluated one by one in the order they are specified. The first rule that matches the current pattern (e.g. username, roles, client IP, address) determines the authorization result. If this rule is an allow rule, the action can be executed; if it is a deny rule, the action cannot be executed; if none of the rules matches the context, the action can still be executed.','Private 1-2-1, Group','2012-11-26 09:04:19','2012-11-26 11:36:08'),(24,26,NULL,'gia su 26','A message of level error will always be logged when an error occurs. If the error is caused by a PHP warning or notice, the message will be logged with category php; if the error is caused by an uncaught exception, the category would be exception.ExceptionClassName (for CHttpException its statusCode will also be appended to the category). One can thus exploit the logging feature to monitor errors happened during application execution.\r\n$Id$\r\nLogging\r\nWeb Service\r\nBe the first person to leave a comment\r\n\r\nPlease login to leave your comment.\r\n','A message of level error will always be logged when an error occurs. If the error is caused by a PHP warning or notice, the message will be logged with category php; if the error is caused by an uncaught exception, the category would be exception.ExceptionClassName (for CHttpException its statusCode will also be appended to the category). One can thus exploit the logging feature to monitor errors happened during application execution.\r\n$Id$\r\nLogging\r\nWeb Service\r\nBe the first person to leave a comment\r\n\r\nPlease login to leave your comment.\r\nA message of level error will always be logged when an error occurs. If the error is caused by a PHP warning or notice, the message will be logged with category php; if the error is caused by an uncaught exception, the category would be exception.ExceptionClassName (for CHttpException its statusCode will also be appended to the category). One can thus exploit the logging feature to monitor errors happened during application execution.\r\n$Id$\r\nLogging\r\nWeb Service\r\nBe the first person to leave a comment\r\n\r\nPlease login to leave your comment.\r\n','Private 1-2-1','2012-12-04 15:24:04','2013-01-16 09:49:18'),(29,34,NULL,'gia su 34','Subject\r\nLevel\r\nYears Experience\r\nHourly Rate\r\n','     Details\r\n    Login Details\r\n    Contact Details\r\n    Advertisement\r\n    Subjects\r\n    Gallery\r\n    Videos\r\n    Reviews\r\n    Hide My Advert\r\n    Billing\r\n    Upgrade\r\n    Invoices\r\n    Close Account\r\n\r\n    Home /\r\n    My Account /\r\n    Subjects /\r\n    Add Subject\r\n\r\nSubject\r\nLevel\r\nYears Experience\r\nHourly Rate\r\n','Private 1-2-1, Group','2012-12-18 14:33:30','2013-01-29 17:51:47');

