insert  into `pages`(`id`,`title`,`slug`,`body`,`status`,`created`,`updated`) values (-12,'Upgrade Premium','upgrade-premium','Upgrade Premium Account',1,'2013-01-24 14:12:20',NULL),(-11,'Forgot Password','forgot-password','Forgot Password',1,'2013-01-08 17:21:09',NULL),(-10,'Premium Account','premium-account','Premium Account',1,'2012-12-20 15:57:58',NULL),(-9,'Enhance Account','enhance-account','Enhance Account',1,'2012-12-20 15:57:58',NULL),(-8,'Basic Account','basic-account','Basic Account',1,'2012-12-20 15:57:58',NULL),(-7,'Tutor Upgrade','tutor-upgrade','Tutor Upgrade',1,'2012-12-20 15:54:49',NULL),(-6,'Subjects Available','subjects-available','Subject Available',1,'2013-02-18 11:07:22',NULL),(-5,'Tutor\'s Home','tutor-home','Tutor\'s Home',1,'2012-12-06 14:51:21',NULL),(-4,'Home','home','Home',1,'2012-12-06 14:51:21',NULL),(-3,'Site Map','site-map','Site Map',1,'2012-12-06 14:51:21',NULL),(-2,'Contact','contact','Contact',1,'2012-12-06 14:51:21',NULL),(-1,'Feature Suggestion','feature-suggestion','Feature Suggestion',1,'2012-12-06 14:51:21',NULL),(1,'about','about','<p>\r\n	title property<br />\r\n	public string $title;</p>\r\n<p>\r\n	the title of the portlet. Defaults to null. When this is not set, Decoration will not be displayed. Note that the title will not be HTML-encoded when rendering.<br />\r\n	titleCssClass property<br />\r\n	public string $titleCssClass;</p>\r\n<p>\r\n	the CSS class for the portlet title tag. Defaults to &#39;portlet-title&#39;.<br />\r\n	Method Details<br />\r\n	init() method<br />\r\n	public void init()</p>\r\n',1,'2012-11-21 10:23:21','2012-12-19 13:58:29'),(2,'Privacy','privacy','<p>\r\n	<a href=\"/\"><span style=\"color:#000000;\">Can I use my points for a business with more than one location?<br />\r\n	Points are earned for each location. They cannot be transferred from one location to another even if they belong to the same chain of businesses.</span></a></p>\r\n<p>\r\n	<a href=\"/\">Do I have to give up personal information to join?<br />\r\n	All we need is your email address - a phone number is NOT needed. We also ask for your birthday so that businesses can send you a birthday greeting and reward you with some points on your special day.</a></p>\r\n<p>\r\n	<a href=\"/\">How do I redeem my points?<br />\r\n	Just open up the app and click the favorites button to choose the location from which you want to claim your reward. Tap the reward you want - and have earned enough points for - and tap the screen to acknowledge that you want to claim that reward. The server/cashier will enter a 4 digit confirmation code into your phone - that is it.</a></p>\r\n<p>\r\n	<a href=\"/\">Will I get spammed from businesses sending me messages?<br />\r\n	You have 3 options for messages. You can opt out of all messages or you can receive messages only from businesses that are in your favorites and, of course, you can receive message from all businesses. Businesses are limited to the number of messages they can send.</a></p>\r\n<p>\r\n	<a href=\"/\">What if a business temporarily drops out of the DeelioZ program, do I lose my points?<br />\r\n	No. If a business drops out and then signs back on, your points are saved and available for use.</a></p>\r\n',1,'2012-11-07 10:44:06','2012-12-19 13:58:29'),(4,'Terms & Condition','terms-conditions','<p>\r\n	Verify this email address<br />\r\n	&nbsp;<br />\r\n	<br />\r\n	&nbsp;&nbsp; You recently added a new email address to your Yahoo! account, or initiated verification of an existing email address. To verify that you own this email address, simply click on the link below.&nbsp;<br />\r\n	<br />\r\n	&nbsp;&nbsp; Verifying your email address ensures that you can securely retrieve your account information if your password is lost or stolen. You must verify your email address before you can use it on Yahoo! services that require an email address.&nbsp;&nbsp;<br />\r\n	<br />\r\n	&nbsp;&nbsp; For your security, please keep your email address information up-to-date. If this information changes, you can always update it by signing in to your Yahoo! account and changing it from the &quot;My Account&quot; area.</p>\r\n',1,'2012-11-28 14:51:08','2012-12-19 13:58:29'),(5,'Online Safety','online-safety','<p>\r\n	<span style=\"font-size:24px;\">Online Safety</span></p>\r\n',1,'2012-12-18 16:37:35','2012-12-19 13:58:29'),(7,'FAQs','faqs','<p>\r\n	he&#39; lo</p>\r\n<p>\r\n	may co muon hoi gi khong</p>\r\n<p>\r\n	&nbsp;</p>\r\n',1,'2012-12-18 16:43:14','2013-01-09 08:57:48');

